import axios from 'axios'
import { useEffect, useState } from 'react'
import './style.css'

function ListItem() {

    const [pullRequests, setPullRequests] = useState([]);

    useEffect(getPullRequests, [])

    function getPullRequests() {
        axios.get(`http://localhost:3000/webhook`)
            .then(result => {
                setPullRequests(result.data)
                console.log(result);
            })
    }

    return (
        <div className="AllPullRequests">
            <h2>Pull requests</h2>
            {pullRequests.map(requst =>
            <div className="pullRequest">
                <span>{requst}</span>
             {/* <span>{pullRequests.number}</span>
             <span>{pullRequests.changes}</span>
             <span>{pullRequests.sender.id}</span> */}
            </div>
            )}
        </div>
    )
}

export default ListItem
